import asyncio

class TaskQueue:
    def __init__(self):
        self.queue = asyncio.PriorityQueue()
        self.tasks = {}

    async def submit_task(self, func, args, priority=0):
        task = asyncio.create_task(func(*args))
        self.tasks[task] = {'status': 'pending', 'priority': priority}
        await self.queue.put((priority, task))
        return task

    async def run_tasks(self):
        while True:
            priority, task = await self.queue.get()
            self.tasks[task]['status'] = 'running'
            try:
                await task
                self.tasks[task]['status'] = 'completed'
            except Exception as e:
                self.tasks[task]['status'] = 'failed'
                self.tasks[task]['error'] = str(e)
            self.queue.task_done()

    def get_task_status(self, task):
        return self.tasks[task]['status']

