"""Dependency Injection Container

A lightweight dependency injection container for managing object dependencies
and promoting loose coupling between components.
"""

from typing import Dict, Any, Callable, TypeVar, Type
import inspect

T = TypeVar('T')

class DIContainer:
    """Dependency Injection Container for managing dependencies and services."""

    def __init__(self):
        self._services: Dict[str, Any] = {}
        self._singletons: Dict[str, Any] = {}
        self._factories: Dict[str, Callable] = {}

    def register(self, interface: str, implementation: Any, singleton: bool = True) -> None:
        """Register a service implementation.

        Args:
            interface: Service interface name
            implementation: Implementation class or instance
            singleton: Whether to create a single instance (default True)
        """
        if singleton:
            self._singletons[interface] = implementation
        else:
            self._services[interface] = implementation

    def register_factory(self, interface: str, factory: Callable) -> None:
        """Register a factory function for creating services.

        Args:
            interface: Service interface name
            factory: Factory function that returns service instance
        """
        self._factories[interface] = factory

    def get(self, interface: str) -> Any:
        """Get a service instance by interface name.

        Args:
            interface: Service interface name

        Returns:
            Service instance

        Raises:
            KeyError: If service not registered
        """
        # Check singletons first
        if interface in self._singletons:
            service = self._singletons[interface]
            if inspect.isclass(service):
                # Instantiate class with dependency injection
                instance = self._create_instance(service)
                self._singletons[interface] = instance
                return instance
            return service

        # Check factories
        if interface in self._factories:
            return self._factories[interface]()

        # Check regular services
        if interface in self._services:
            service = self._services[interface]
            if inspect.isclass(service):
                return self._create_instance(service)
            return service

        raise KeyError(f"Service '{interface}' not registered")

    def _create_instance(self, cls: Type[T]) -> T:
        """Create an instance with dependency injection.

        Args:
            cls: Class to instantiate

        Returns:
            Instance with injected dependencies
        """
        # Get constructor signature
        sig = inspect.signature(cls.__init__)
        params = {}

        for param_name, param in sig.parameters.items():
            if param_name == 'self':
                continue

            # Try to resolve dependency by parameter name
            try:
                params[param_name] = self.get(param_name)
            except KeyError:
                # Try to resolve by type annotation if available
                if param.annotation != inspect.Parameter.empty:
                    try:
                        service_name = param.annotation.__name__.lower()
                        params[param_name] = self.get(service_name)
                    except (KeyError, AttributeError):
                        # Use default value if available
                        if param.default != inspect.Parameter.empty:
                            params[param_name] = param.default
                        else:
                            raise KeyError(f"Cannot resolve dependency '{param_name}' for {cls.__name__}")
                elif param.default != inspect.Parameter.empty:
                    params[param_name] = param.default
                else:
                    raise KeyError(f"Cannot resolve dependency '{param_name}' for {cls.__name__}")

        return cls(**params)

    def create(self, cls: Type[T]) -> T:
        """Create an instance of a class with dependency injection.

        Args:
            cls: Class to instantiate

        Returns:
            Instance with injected dependencies
        """
        return self._create_instance(cls)

    def has(self, interface: str) -> bool:
        """Check if a service is registered.

        Args:
            interface: Service interface name

        Returns:
            True if service is registered, False otherwise
        """
